import {useEffect} from "react";
import {allCategories} from "../Api/allCategories";

const SubMenu = () => {
  const menuDummy = [
    "electronics",
    "jewelery",
    "men's clothing",
    "women's clothing"
  ]

  return (
   <>
     {menuDummy && menuDummy.map((item,index) => (
      <li key={index}>{item}</li>
     ))}
   </>
  )
}
export default  SubMenu;
